import React from 'react'
import { Col, Row } from 'react-bootstrap';
import products from "../data/product";
const Homescreen = () => {
    return (
        <>
            <h1>Latest Products</h1>
            <Row>
                {
                    products.map((ele, i) => (
                        <Col>
                            <h3>{ele.name}</h3>
                        </Col>
                    ))
                }
               
            </Row>
        </>
    )
}

export default Homescreen
